import React from 'react';

import StreamInfo from './StreamInfo';

// northernlion: offline, rockleesmile: offline, dumbdog: offline, michaelalfox: offline, jsmithoti: offline, alpacapatrol: offline, cobaltstreak: offline, baertaffy: offline, dangheesling: offline, sinvicta: offline, lovelymomo: offline, mathas: offline, flackblag: offline, hcjustin: offline, itshafu: offline

let streamers = [
    'northernlion',
    'rockleesmile',
    'dumbdog',
    'michaelalfox',
    'jsmithoti',
    'alpacapatrol',
    'cobaltstreak',
    'baertaffy',
    'dangheesling',
    'sinvicta',
    'lovelymomo',
    'mathas',
    'flackblag',
    'hcjustin',
    'itshafu'
]



class App extends React.Component {

    renderStreamer(streamer) {
        return <StreamInfo user={streamer} />
    }

    render() {
        return(
            <div>
                <div onClick={() => this.onClick()}id="countdown">this is a countdown</div>
                <div id="people-container">
                    <StreamInfo user='dumbdog' />
                    streamers.map(this.renderStreamer)
                </div>
            </div>
        )
    }
}

export default App;
